import React, { Component } from 'react';

const estilosTodoCounter = {
  backgroundColor: 'red'
}

function TodoCounter({ total, completed }) {
  return (
    < React.Fragment>
      <h1 style={estilosTodoCounter} >Has completado {completed} de {total} TODOs</h1>
      <h1 style={{ backgroundColor: '#f5f5f7' }} >Has completado {completed} de {total} TODOs</h1>
    </React.Fragment>
  );
}

export { TodoCounter };
